function App() {
  if (isMobile) {
    return (
      <div className="App">
        <HeaderMobile />
        <Router>
          <Switch>
            <Route path="/" exact>
              {/* <HomeMobile /> */}
            </Route>
          </Switch>
        </Router>
      </div>
    );
  }
  return (
    <div className="App">
      <HeaderDesktop />
      <Router>
        <Switch>
          <Route path="/" exact>
            {/* <HomeDesktop /> */}
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
